// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

import "./BEP20.sol";
import "./SafeMath.sol";

contract BEP20Detailed  {
    string private _name;
    string private _symbol;
    uint8 private _decimals;

    /**
     * @dev Sets the values for `name`, `symbol`, and `decimals`. All three of
     * these values are immutable: they can only be set once during
     * construction.
     */
    constructor (string memory projectName, string memory tokenSymbol, uint8 TokenDecimals) {
        _name        = projectName;
        _symbol      = tokenSymbol;
        _decimals    = TokenDecimals;
    }

    /**
     * @dev Returns the name of the token.
     */
    function name() public view returns (string memory) {
        return _name;
    }

    /**
     * @dev Returns the symbol of the token, usually a shorter version of the
     * name.
     */
    function symbol() public view returns (string memory) {
        return _symbol;
    }

    /**
     * @dev Returns the number of decimals used to get its user representation.
     * For example, if `decimals` equals `2`, a balance of `505` tokens should
     * be displayed to a user as `5,05` (`505 / 10 ** 2`).
     *
     * Tokens usually opt for a value of 18, imitating the relationship between
     * Ether and Wei.
     *
     * NOTE: This information is only used for _display_ purposes: it in
     * no way affects any of the arithmetic of the contract, including
     * {IBEP20-balanceOf} and {IBEP20-transfer}.
     */
    function decimals() public view returns (uint8) {
        return _decimals;
    }
}

contract MekaMiners is BEP20, BEP20Detailed {
       using SafeMath for uint256;
       
    constructor() BEP20Detailed("MekaMiners", "MEKA", 18) {
        _mint(msg.sender, 200000000 * 10 ** decimals());
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function mint(address to, uint256 amount) public onlyOwner {
        _mint(to, amount);
    }

     function transfer(address _receiver, uint256 _amount) public override returns (bool success) {
        require(_receiver != address(0)); 

        return BEP20.transfer(_receiver, _amount);
    }

    function transferFrom(address _from, address _receiver, uint256 _amount) public override  returns (bool) {
        require(_from       != address(0), "from can't be address zero");
        require(_receiver   != address(0), "receiver can't be address zero");
        require(_amount     <= allowance(_from, msg.sender), "amount must be less or equal the allowance");

        return BEP20.transferFrom(_from, _receiver, _amount);
    }
}

